__NUXT_JSONP__("/svet/misto/waw-an-namus", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u,v,w,x,y,z,A,B,C,D,E,F,G,H){return {data:[{place:[{id:q,id_city:a,id_image_cover:a,id_image_hero:a,created_at:r,slug:s,name:t,information_chatgpt:u,type_place:v,coordinates:[{latitude:w,longitude:x}],zoom:[{google:y,booking:z}],affiliate:[{name:k,value:A}],id_state:l,altitude:B,information_author:a,seo_tags:a,information_duration:a,updated_at:C,name_original:a,type_spot:a,setting_top:e,setting_status_public:g}],imagePlace:[],placeCity:a,imagePlaceCity:a,placeState:[{tld:".ly",name:"Libye",area:1759540,population:6871287,slug:"libye",id_continent:d,information_chatgpt:"\u003Cp\u003ELibye je severoafrický stát, který hraničí s Tuniskem, Alžírskem, Nigerem, Čadem, Súdánem a Středozemním mořem. Má rozlohu 1,8 milionu km² a v roce 2021 zde žilo přibližně 6,9 milionu lidí. Hlavním městem je Tripolis.\u003C\u002Fp\u003E\n\u003Cp\u003ELibye je bohatá na přírodní krásy, jako jsou pouště, hory, oázy a pláže na pobřeží Středozemního moře. Nejvyšší horou je Bikku Bitti s nadmořskou výškou 2 267 metrů. V zemi se nachází také mnoho archeologických nalezišť, jako například antická města Leptis Magna a Sabratha, která jsou zapsána na seznamu UNESCO.\u003C\u002Fp\u003E\n\u003Cp\u003ELibye je také známá svým bohatstvím na ropu a plyn, což z ní dělá významného hráče na mezinárodních trzích. Díky tomu zde najdete moderní města s vysokými mrakodrapy a luxusní hotely.\u003C\u002Fp\u003E\n\u003Cp\u003EBohužel, Libye se také potýká s politickou nestabilitou a násilím. Během arabského jara v roce 2011 došlo k povstání proti diktátoru Muammara Kaddáfího, který byl nakonec svržen a zemřel. Nicméně, země se stala místem bojů a konfliktů mezi různými frakcemi, které pokračují dodnes.\u003C\u002Fp\u003E",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Big Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:D,date_update:b},{name:"Policie",value:"1515",date_update:b},{name:"Hasiči",value:"101",date_update:b},{name:"Zdravotnická záchranná služba",value:D,date_update:b}],phone_prefix:"+218",coordinates:[{latitude:"26.3351",longitude:"17.2283"}],people_religion:[{name:"Islám",value:"97%"},{name:"Křesťanství",value:"2%"},{name:E,value:"1%"}],people_nationality:[{name:"Libyjci",value:"90 %"},{name:"Berbeři",value:"9 %"},{name:E,value:"1 %"}],visitors_entry:[{name:"Občanský průkaz",value:"Občanský průkaz není platným cestovním dokladem pro vstup do Libye. Pro vstup do země je nutné mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup do Libye je nutné mít platný cestovní pas. Pas musí být platný minimálně 6 měsíců od data vstupu do země.",date_update:b},{name:"Vízum",value:"Pro vstup do Libye je většinou potřeba vízum. Občané Evropské unie mohou získat vízum na hranici za poplatek. Pro vízum je nutné mít platný cestovní pas, fotografii a potvrzení o ubytování. Přesné podrobnosti a ceny víz se mohou lišit v závislosti na státní příslušnosti a délce pobytu.",date_update:b},{name:"Očkování",value:"Pro vstup do Libye není vyžadováno žádné specifické očkování. Doporučuje se však očkování proti běžným infekčním chorobám jako jsou žloutenka A a B, tetanus, spála a záškrt.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup do Libye není vyžadováno cestovní ani zdravotní pojištění. Nicméně je silně doporučeno uzavřít si tyto druhy pojištění pro případné nečekané situace a úrazy během cesty.",date_update:b},{name:"Bezpečnostní situace",value:"Bezpečnostní situace v Libyi je velmi nestabilní a nebezpečná. V zemi probíhá ozbrojený konflikt, teroristické útoky jsou běžné a je vysoké riziko únosek a útoků na cizince. Ministerstvo zahraničí ČR nedoporučuje cestování do této země, výjimkou jsou jen některé profesionální cesty s důležitými bezpečnostními opatřeními.",date_update:b},{name:"Další informace",value:"Při cestování do Libye je důležité si uvědomit, že v zemi panuje jiná kultura a zvyklosti než v Evropě. Je vhodné respektovat místní zvyklosti a zákony, například alkohol je zakázán a veřejné projevy náboženského či politického extremismu jsou trestné. Při pobytu v Libyi je důležité dodržovat bezpečnostní opatření, vyhnout se nebezpečným oblastem a být ostražitý vůči podezřelým situacím.",date_update:b}],type_place:"state",id_image_cover:F,id_image_hero:F,id_city_main:1328,affiliate:[{name:k,value:e}],mpz:"LY",alerts:a,zoom:[{google:d,booking:d}],ids_neighboring_countries:[{id:62},{id:65},{id:m},{id:196},{id:215},{id:223}],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:l,facts_place:a,created_at:"2023-12-27T16:33:10.517062+00:00",updated_at:"2024-03-04T19:48:12.84066+00:00",name_original:a,currency:[{code:"LYD",name:"libyjský dinár"}],setting_top:e,setting_status_public:g}],placeContinent:[{id:d,slug:"afrika",name:"Afrika",area:30370000,population:1340000000,population_density:44.12,number_states:54,information_chatgpt:"\u003Cp\u003EAfrika je největší kontinent na Zemi a rozkládá se na ploše přesahující 30 milionů kilometrů čtverečních. Nachází se zde více než 50 zemí a žije zde více než 1,3 miliardy lidí. \u003C\u002Fp\u003E\n\u003Cp\u003EJižní Afrika, Egypt, Maroko a Keňa patří mezi nejoblíbenější turistické cíle v Africe. V Jihoafrické republice se můžete podívat na slavné Krugerův národní park a sledovat zde život zvířat v jejich přirozeném prostředí. Egypt je zase proslulý svými pyramidami, které se nacházejí v Gíze. V Maroku můžete navštívit tradiční trhy, zatímco v Keni se můžete setkat s Masajským kmenem a podívat se na úžasnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má bohatou historii a kulturu. První lidé, kteří se usadili v Africe, byli loveckým a sběračským národem. Poté se v této oblasti objevily první civilizace, jako je Kúšská říše, Egyptská říše nebo Království Aksum. Afrika byla také kolonizována evropskými mocnostmi a toto období mělo značný dopad na dnešní politickou situaci na kontinentu.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité zmínit, že Afrika má velké množství jazyků a kultur. Zahrnuje mnoho různých národů a etnických skupin, a to má vliv na různorodost obyvatelstva a kultury. Nejrozšířenějším jazykem je arabština, která se mluví především v severní Africe a v některých částech západní Afriky. Dalšími důležitými jazyky jsou svahilština, francouzština, portugalština, angličtina a mnoho dalších.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika má také nádhernou přírodu. Nachází se zde nejvyšší hora světa, Kilimandžáro, která se nachází na území Tanzanie a Keňy. Kromě toho se v Africe nachází také největší pouště na světě, Sahara, a největší prales, Kongský prales. Na tomto kontinentě můžete vidět také mnoho zvířat, jako jsou sloni, lvi, gepardi, zebry a mnoho dalších druhů. V Africe se také nachází několik nejvýznamnějších řek světa, jako je Nil, Kongo, Niger a Zambezi.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je bohužel také známá pro své problémy. Mnoho zemí se potýká s chudobou, nedostatkem potravin a vody, nemocemi a válečnými konflikty. Mnoho afrických zemí závisí na zemědělství a rybolovu, což však často není dostatečně výnosné, aby zabezpečilo potřeby obyvatelstva. Kromě toho jsou některé země v Africe trvale postižené extrémními přírodními katastrofami, jako jsou sucha, povodně a bouře.\u003C\u002Fp\u003E\n\u003Cp\u003ENa druhou stranu se v Africe také nachází mnoho lidí, kteří se snaží změnit situaci a zlepšit životy svých spoluobčanů. Vznikají neziskové organizace, které se snaží pomáhat při řešení těchto problémů a zlepšovat kvalitu života v mnoha afrických zemích. Zároveň se v posledních letech objevují nové možnosti pro ekonomický růst a rozvoj, jako jsou technologické start-upy a zahraniční investice.\u003C\u002Fp\u003E\n\u003Cp\u003EAfrika je fascinující kontinent, který nabízí mnoho zážitků a zároveň v sobě ukrývá mnoho výzev. Pokud se rozhodnete navštívit Afriku, můžete se těšit na krásnou přírodu, bohatou kulturu a nezapomenutelné zážitky. Je však také důležité být obezřetný a připravený na místní podmínky, protože některé oblasti mohou být nebezpečné kvůli konfliktům nebo zločinnosti.\u003C\u002Fp\u003E",coordinates:[{latitude:1.650801,longitude:17.371642}],type_place:"continent",id_image_cover:d,id_image_hero:d,zoom:[{google:2,booking:3}],information_author:[{text:"\u003Cp\u003E\u003Cb\u003EAfrika\u003C\u002Fb\u003E, druhý největší a druhý nejlidnatější kontinent na světě, láká cestovatele svou neuvěřitelnou rozmanitostí kultur, přírodními krásami a bohatou historií. Při cestování touto obrovskou plochou se otevírá mozaika různorodých zážitků, které zahrnují odlesky moderního městského života, divokou přírodu až po historická místa.\u003C\u002Fp\u003E\u003Cp\u003EJižní Afrika, domov několika národních parků a rezervací, je rájem pro milovníky safari. \u003Cb\u003EKrugerův národní park (Kruger National Park)\u003C\u002Fb\u003E nabízí úžasné setkání s \"Velkým pětkou\" - slony, nosorožci, buvoly, lvy a levharty. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fcape-town\"\u003EKapské Město (Cape Town)\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s ikonickou horou \u003Cb\u003EMaclear's Beacon\u003C\u002Fb\u003E, poskytuje nezapomenutelný výhled na město a okolní krajinu.\u003C\u002Fp\u003E\u003Cp\u003EVýchodní Afrika je známá svými ohromujícími sopkami. \u003Cb\u003EKilimandžáro\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nejvyšší hora Afriky, přitahuje dobrodruhy a horolezce z celého světa. Návštěva \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003EZanzibaru\u003C\u002Fa\u003E\u003C\u002Fb\u003E s jeho bílými plážemi a historickým centrem \u003Cb\u003EStone Town\u003C\u002Fb\u003E přidává do cestovatelského mixu kouzlo exotiky.\u003C\u002Fp\u003E\u003Cp\u003EStřední Afrika, s obrovskou rovníkovou pralesní plochou, skrývá některé z nejzajímavějších biodiverzit na světě. \u003Cb\u003EKonžský deštný prales\u003C\u002Fb\u003E je po amazonském druhý největší na světě, je domovem vzácných druhů zvířat a rostlin, a expedice sem mohou odhalit tajemství dosud neobjevená.\u003C\u002Fp\u003E\u003Cp\u003ESeverní Afrika je poznamenána starověkými civilizacemi a písečnými pouštěmi. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fegypt\"\u003EEgypt\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pyramidami a chrámy na březích \u003Cb\u003ENilu\u003C\u002Fb\u003E je jednou z nejnavštěvovanějších destinací v této části kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmaroko\"\u003EMaroko\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s mistrovským spojením tradice a moderny v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmarrakes\"\u003EMarrákeši\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je fascinujícím mixem barev, vůní a architektury.\u003C\u002Fp\u003E\u003Cp\u003EZápadní Afrika, bohatá na kulturní dědictví, nabízí autentické zážitky. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fghana\"\u003EGhana\u003C\u002Fa\u003E\u003C\u002Fb\u003E s pevnostmi, které připomínají období otroctví, a kultovními festivaly představuje hluboký pohled do minulosti. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsenegal\"\u003ESenegal\u003C\u002Fa\u003E\u003C\u002Fb\u003E, s historickým ostrovem \u003Cb\u003EGorée\u003C\u002Fb\u003E, který sehral roli s obchodem s otroky, kde najdete koloniální budovy a muzeum \u003Cb\u003EHouse of Slaves (Maison des esclaves)\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\u003Cp\u003EAfrika je rovněž známá svými divokými zvířaty. Kromě safari v jižní části kontinentu můžete zažít jedinečnou příležitost sledovat migraci tisíců zeber a gazel v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fkena\"\u003EKeni\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftanzanie\"\u003ETanzanii\u003C\u002Fa\u003E\u003C\u002Fb\u003E. Návštěva gorilí v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Frwanda\"\u003ERwandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fuganda\"\u003EUgandě\u003C\u002Fa\u003E\u003C\u002Fb\u003E je neopakovatelným zážitkem pro ty, kteří touží po setkání s těmito ohroženými tvory.\u003C\u002Fp\u003E\u003Cp\u003EPřírodní skvosty nejsou omezeny pouze na pevninskou část kontinentu. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fseychely\"\u003ESeychely\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMauricius\u003C\u002Fa\u003E\u003C\u002Fb\u003E, dvě ostrůvky v \u003Cb\u003EIndickém oceánu\u003C\u002Fb\u003E, lákají svými bílými plážemi, průzračnými vodami a jedinečnou faunou a florou.\u003C\u002Fp\u003E\u003Cp\u003EAfrika rovněž hýří kulturou a historií. Starověké památky jako \u003Cb\u003EGreat Zimbabwe National Monument\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fzimbabwe\"\u003EZimbabwe\u003C\u002Fa\u003E\u003C\u002Fb\u003E nebo \u003Cb\u003ETimbuktu (Tombouctou)\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fmauricius\"\u003EMali\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou svědectvím o bohaté historii a rozvoji obchodu a kultury na africkém kontinentu. Každý region má své vlastní tradiční tance, hudbu a umění, které odrážejí místní identitu a historii.\u003C\u002Fp\u003E\u003Cp\u003ECestování Afrikou je také o interakci s místními lidmi. Přívětivost a pohostinnost afrických komunit jsou nezapomenutelnými součástmi cestování. Místní trhy nabízejí pestrou škálu barev, vůní a chutí, zatímco setkání s kmeny a etnickými skupinami přináší pochopení různorodosti kultur a tradic.\u003C\u002Fp\u003E\u003Cp\u003EJe však důležité si být vědomý sociálních, ekonomických a environmentálních výzev, kterým mnohé africké země čelí. Cestovatelé by měli být respektující vůči místním zvyklostem a životnímu prostředí a přispívat k udržitelnému turismu, který podporuje místní ekonomiky a ochranu přírodních zdrojů.\u003C\u002Fp\u003E\u003Cp\u003ECelkově lze říci, že cestování po Africe je dobrodružstvím naplněným kontrasty a překvapeními. Od rozlehlých savan po exotické pláže, od starověkých ruin po moderní metropole. Afrika nabízí cestovatelům nekonečné možnosti objevování a poznávání. Je to kontinent, který zanechává nezapomenutelný dojem na každém, kdo se odhodlá k jeho prozkoumání.\u003C\u002Fp\u003E",date_create:G,date_update:G,author_create:H,author_update:H}],seo_tags:[],created_at:"2023-12-27T16:35:37.460505+00:00",updated_at:"2024-03-04T19:48:06.634661+00:00",name_original:"Africa",setting_top:e,setting_status_public:g}]}],fetch:{"OrganismsoPlaceTeaserListComponent:0":{items:[{id:q,id_city:a,id_image_cover:a,id_image_hero:a,created_at:r,slug:s,name:t,information_chatgpt:u,type_place:v,coordinates:[{latitude:w,longitude:x}],zoom:[{google:y,booking:z}],affiliate:[{name:k,value:A}],id_state:l,altitude:B,information_author:a,seo_tags:a,information_duration:a,updated_at:C,name_original:a,type_spot:a,setting_top:e,setting_status_public:g}],images:a,imageSizesMedia:[{mediaQueriesWidth:349,elementWidth:h},{mediaQueriesWidth:374,elementWidth:f},{mediaQueriesWidth:399,elementWidth:f},{mediaQueriesWidth:459,elementWidth:n},{mediaQueriesWidth:575,elementWidth:m},{mediaQueriesWidth:767,elementWidth:i},{mediaQueriesWidth:991,elementWidth:o},{mediaQueriesWidth:1219,elementWidth:j},{mediaQueriesWidth:1399,elementWidth:268},{mediaQueriesWidth:a,elementWidth:p}],imageSizes:[{elementWidth:h,imageWidth:f,orientation:c},{elementWidth:f,imageWidth:f,orientation:c},{elementWidth:n,imageWidth:n,orientation:c},{elementWidth:m,imageWidth:j,orientation:c},{elementWidth:i,imageWidth:i,orientation:c},{elementWidth:o,imageWidth:o,orientation:c},{elementWidth:j,imageWidth:j,orientation:c},{elementWidth:208,imageWidth:i,orientation:c},{elementWidth:p,imageWidth:p,orientation:c}]},"OrganismsoSidebarEventComponent:0":{events:[],images:a,imageSizesMedia:[{mediaQueriesWidth:a,elementWidth:0}],imageSizes:[{elementWidth:h,imageWidth:h,orientation:"s-"}]}},mutations:[]}}(null,"05-2023","h-",5,true,108,1,100,220,172,"booking",136,162,126,192,312,58,"2023-12-14T15:38:46.307155+00:00","waw-an-namus","Waw an Namus","\u003Cp\u003EWaw an Namus, což v arabštině znamená \"Oáza Moskytů\", je fascinující lokalita nacházející se v nejodlehlejší části Libye. Pro cestovatele představuje tato oblast jedinečnou kombinaci přírodního divadla, archeologických nálezů a neopakovatelného kulturního dědictví.\u003C\u002Fp\u003E\n\u003Cp\u003ESrdcem Waw an Namus je sopečný kráter o průměru více než 20 kilometrů, jehož dno tvoří slané jezero. Tato exotická krajina je obklopena černými sopečnými poli a strmými skalními stěnami, které vytvářejí dojem surrealistického prostředí. Cestovatelé mohou prozkoumávat okolní duny a pozorovat unikátní faunu a flóru, která se dokázala přizpůsobit drsným podmínkám této oblasti.\u003C\u002Fp\u003E\n\u003Cp\u003EPro archeology a historiky je Waw an Namus fascinujícím místem, protože v této odlehlé oblasti byly objeveny pravěké petroglyfy a nálezy ukazující na dávnou lidskou přítomnost. Pro milovníky adrenalinových zážitků může být výstup na okraj kráteru vzrušujícím dobrodružstvím s nezapomenutelnými výhledy na okolní poušť a sopečné tvary.\u003C\u002Fp\u003E\n\u003Cp\u003EJe však důležité zdůraznit, že Waw an Namus není pro každého, protože cesta do této oblasti vyžaduje dobrou přípravu a zkušenost s přežíváním v extrémních podmínkách. Bezpečnostní opatření a dostatečné zásoby jsou klíčové pro úspěšný a bezpečný výlet do této jedinečné oázy v srdci libyjské pouště.\u003C\u002Fp\u003E\n\u003Cp\u003ETento magický koutek Libye nabízí cestovatelům neopakovatelný zážitek spojený s přírodou, historií a dobrodružstvím, který zanechá dlouhotrvající dojem na každém, kdo se rozhodne objevit krásy Waw an Namus.\u003C\u002Fp\u003E","spot",24.91663,17.766667,14,13,false,505,"2024-03-04T19:48:35.968071+00:00","193","Jiné",299,"2024-03-01","1")));